text:
Prezentacja:
lekko zmętnione, prawie przejrzyste, bardzo obfita piana opada do trwałej dziurawej postrzępionej chmury, średnio zdobi szkło;
Aromat:
bardzo intensywny sok multiwitamina, potem przechodzi w marakuję, słodką cytrynę;
Odczucie:
ciało niskie ku średniemu, średnio nasycone, z goryczkowym finiszem, lekko wykleja podniebienie;
Smak:
sok multiwitamina, słodka cytryna, bardzo długa przyjemna chlebowo-drewniana goryczka;
Ogólnie:
fajne, słodkie, ale skontrowane goryczką.
